import { store } from "../store/index";
export function setIdsanphammoi(text) {
  return {
    type: "sanphammoi",
    db: text
  };
}
export function setIdphukien(text) {
  return {
    type: "ADD_TOCART",
    db:text
  };
}
export function dispatchBtnAction(data) {
  store.dispatch(setIdphukien(data));
}
